import React from 'react';
import useForm from './useForm';
import { Copyright, theme, useStyles } from './registerStyle';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Paper from '@material-ui/core/Paper';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import ThemeProvider from '@material-ui/core/styles';
import Fanlinclogo from './img/fanlinc_logo.png';

const initialState = {
  firstName: "",
  lastName: "",
  username: "",
  password: "",
  password_confirmation: "",
  dateOfBirth: "",
  bio: "",
  location: "",
  profilePhotoUrl: ""
};

export default function Register() {
  const { values, handleChange, handleSubmit } = useForm(submit, initialState);

  function submit() {
    console.log("sumitted form");
  }

  const classes = useStyles();

  return (
    <ThemeProvider theme={theme}>
      <Grid container component="main" className={classes.Root}>
        <CssBaseline />
        <Grid item />
        <Grid
          item
          md={4}
          style={{ textAlign: "center" }}
          component={Paper}
          elevation={0}
          square
        />

        <div className={classes.Paper}>
          <img src={Fanlinclogo} height="70" width="70" />
          <Typography component="h1" variant="h5">
            Sign Up!
          </Typography>
          <form
            className={classes.form}
            noValidate
            onSubmit={handleSubmit}
          >
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="firstName"
              label="First Name"
              name="firstName"
              onChange={handleChange}
            />
            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              className={classes.submit}
              color="primary"
            >
              Sign Up
            </Button>
            <Grid container>
              <Grid item xs>
                <Link href="#" variant="body2">
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link href="#" variant="body2">
                  {"Don't have an account? Sign Up"}
                </Link>
              </Grid>
            </Grid>
            <Box mt={5}>
              <Copyright />
            </Box>
          </form>
        </div>
      </Grid>
    </ThemeProvider>
  );
}
